ounded_year\": \"2008\", \"verksamhet_raw\": \"Pensionärsverksamhet, Socialverksamhet\", \"short_description\": \"Äldrekontakt är en ideell förening som har som övergripande målsättning att främja hälsa och välbefinnande hos äldre. Särskilt hos äldre som befinner sig i en psykiskt, fysiskt, socialt och/eller ekonomiskt utsatt situation. Rent konkret främjar vi hälsa och välbefinnande hos äldre genom att minska ofrivillig ensamhet och sociala isolering. Vi har utvecklat en effektfull metod, baserad på forskning, som hjälper äldre ur ensamheten, genom att möjliggöra för dem att regelbundet träffa jämnåriga och samtidigt umgås över generationsgränserna. Vi har 17 års erfarenhet som visar att det går att göra stor skillnad i ensamma äldres liv. Vi kallar de äldre som vi hjälper för ”våra gäster”. Detta kommer naturligt för oss eftersom vi vill skapa en respektfull, varm, inkluderande och vänlig atmosfär i det vi gör.Äldrekontakt driver i dagsläget verksamhet i över 60 kommuner runtom i landet, där över 1700 volontärer varje månad hjälper 1200 ensamma äldre att träffas. Vi har funnits på Ekerö sedan 2018 och har i dagsläget två fikagrupper med upp till 8 äldre gäster i varje grupp, där grupp nummer 2 startade under 2024.\", \"national_affiliation\": null, \"fiscal_year_starts_mmdd\": \"0101\"}, \"title\": \"Övrig information\"}], \"free_text\": \"Äldrekontakt är en ideell förening som har som övergripande målsättning att främja hälsa och välbefinnande hos äldre. Särskilt hos äldre som befinner sig i en psykiskt, fysiskt, socialt och/eller ekonomiskt utsatt situation. Rent konkret främjar vi hälsa och välbefinnande hos äldre genom att minska ofrivillig ensamhet och sociala isolering. Vi har utvecklat en effektfull metod, baserad på forskning, som hjälper äldre ur ensamheten, genom att möjliggöra för dem att regelbundet träffa jämnåriga och samtidigt umgås över generationsgränserna. Vi har 17 års erfarenhet som visar att det går att göra stor skillnad i ensamma äldres liv.