eckla den biten.\"}','UNCONTACTED',0,NULL,'PROSPECT',4,5,'numeric_plus_next_last',NULL,'{\"founded_year\": 2024, \"contact_phones\": {\"mobile\": \"\"}, \"verksamhet_raw\": \"Basket, Bordtennis, Djur och natur, Fotboll, Innebandy, Käpphästridning\", \"fiscal_year_start\": \"0101\", \"national_affiliation\": \"Junis\"}','2025-10-24 06:25:13.430','2025-10-24 06:25:13.430','cmh3lhlze0003b5q8gbvxa35w','cmh4gvd4n0001oz01jrhl9ydr',NULL,0,'Föreningen har en stark vision att erbjuda meningsfulla och lärorika upplevelser för barn och ungdomar, med fokus på harmoni mellan människa, djur och natur. Då intresset visats stort för bollsporter försöker vi gynna även det. Hästis - En dag i veckan:Vi välkomnar varje vecka barn från skolan till vårt stall för en dag fylld med lärande och äventyr. Genom vårt program får barnen möjlighet att lära sig grunderna i hästskötsel, både praktiskt och teoretiskt. Vi strävar efter att ge dem en djupare förståelse för hästvård och hantering, samtidigt som de får möjlighet att prova på grundläggande ridning, med fokus på säkerhet och respekt för djuret. Dessutom planerar vi att fira högtider såsom påsk, Halloween och jul med olika teman för att skapa roliga och minnesvärda upplevelser för barnen.Ponnypatrullen - En dag för nybörjare:Vi kommer även att introducera en dag för Ponnypatrullen, där vi välkomnar nybörjare till stallet för att utforska skogen och delta i enklare ridpass på banan. Målet med gruppen är att främja harmoni och samspel med både hästar och natur. Liksom i Hästis-programmet kommer barnen att få lära sig grunderna i hästskötsel och ridning, vilket förväntas bidra till deras personliga utveckling och ökade självförtroende.Medryttareprogram:Vi kommer att fortsätta erbjuda möjligheten för barn och ungdomar att bli medryttare på våra hästar. Genom individuellt anpassade ridlektioner får varje deltagare möjlighet att utvecklas som ryttare, med stöd och vägledning från vårt erfarna team.Sommarläger:Vi planerar att arrangera hästläger