 en väl fungerande verksamhet som vi är väldigt stolta över.Mälaröarnas Hockeyförening har sin hemvist i båda av Ekerö Kommuns ishallar,Vikingahallen som ligger vid Träkvista IP och Allhallen som ligger vid Svanängens IP.Mälaröarnas Hockeyförening är en av Stockholms största hockeyföreningar om man räknar antalet aktiva spelare. Det är fantastiskt och ett resultat av hårt arbete med att aktivera barn och ungdomar till att börja spela ishockey. Idrotten är och kommer att vara ett av samhällets viktigaste funktioner. Det är inom idrotten vi sätter grunderna till god hälsa, gemenskap, sysselsättning och bra värderingar vilket är mycket bra för vårt samhälle i övrigt.\", \"national_affiliation\": \"Sv.Ishockeyförbundet\", \"fiscal_year_starts_mmdd\": \"0501\"}, \"title\": \"Övrig information\"}], \"free_text\": \"Mälarö Hockeyförening est. 2021Mälarö hockeyförening bildades den 29 mars 2021 men har en historia som sträcker sig tillbaka till Ekerö IK och Skå IKs bildande.Från och med säsongen 21/22 så samlades vi i Mälaröarnas Hockeyförening.Föreningen bedriver hockeyverksamhet på Mälaröarna men några av våra spelare kommer från ”fastlandet” så det är inte bara spelare från Mälaröarna som väljer att spela ishockey hos oss.Vi är i dagsläget över 850 hockeymedlemmar i våra lag som täcker allt från A-lag ner till skridskoskolan, Veteraner till flicklag. Det är ett bevis på en väl fungerande verksamhet som vi är väldigt stolta över.Mälaröarnas Hockeyförening har sin hemvist i båda av Ekerö Kommuns ishallar,Vikingahallen som ligger vid Träkvista IP och Allhallen som ligger vid Svanängens IP.Mälaröarnas Hockeyförening är en av Stockholms största hockeyföreningar om man räknar antalet aktiva spelare. Det är fantastiskt och ett resultat av hårt arbete med att aktivera barn och ungdomar till att börja spela ishockey. Idrotten är och kommer att vara ett av samhällets viktigaste funktioner. Det är inom idrotten vi sätter grunderna till god hälsa, gemenskap, sysselsättning och bra v