r och damer i laget. Vi tränar två gånger i veckan under säsongen.\"}','UNCONTACTED',0,NULL,'PROSPECT',1,4,'numeric_plus_next_last',NULL,'{\"founded_year\": 1973, \"contact_phones\": {\"mobile\": \"0702614601\"}, \"verksamhet_raw\": \"Bowling\", \"fiscal_year_start\": \"0601\", \"national_affiliation\": \"Svenska Bowlingförbundet\"}','2025-10-24 09:25:30.301','2025-10-24 09:25:30.301','cmh3lhm7e000tb5q8o1ngr574','cmh4nb8pa00ttoz01innubkvm',NULL,0,'Bowlingklubben har två lag i seriespel med spelare i olika åldrar samt att det är både herrar och damer i laget. Vi tränar två gånger i veckan under säsongen.',NULL,NULL),('cmh4nb8t000ufoz01vuhsm7rg','FRI',NULL,'2025-10-23 10:29:04.920','https://fri.fagersta.se/forening/visa.aspx?id=BRUKET-BK','Bruket BK',NULL,'[\"Idrottsförening\"]','[\"Fotboll\"]','[]','https://www.laget.se/bruketbk','Cactusvägen 7C','737 44','Fagersta','bruketbk@gmail.com',NULL,'{\"sections\": [{\"data\": {\"founded_year\": \"2021\", \"verksamhet_raw\": \"Fotboll\", \"short_description\": \"Bruket BK är ett fotbollslag som inte bara går för vinst på planen, utan också för att skapa en bättre och mer gemenskapsorienterad fotbollskultur i Fagersta.Vårt engagemang stannar dock inte där. Vi ser oss nämligen inte bara som ett fotbollslag, vi är en familj och en kraft som arbetar för integration, samhörighet och att knyta vänskapsband genom fotbollen. Vårt engagemang för Fagerstas fotbollsintresserade är något som vi är mycket stolta över.Att vi finns som ett alternativ för de vuxna och ungdomar som inte har råd eller som inte finner någon plats i stadens mer elitsatsande föreningar, är något som har mottagits varmt. Ett alternativ till FSIK och VIF är något som har saknats under många år och vi ser det som vår plikt att fortsätta finnas till för de som behöver det.En av våra mest framstående aspekter är vårt fokus på att involvera spelare oavsett ålder och tidigare erfarenhet.Vi har en imponerande grupp unga talanger som är passionerade för fotboll och som är redo att växa och utvecklas med oss. Vi har även äldre spelare som inte vill sluta spela så länge kroppen fortfarande orkar.Vi tror att genom att investera i dessa ungdomar och vuxna, investerar vi i en mer inkluderande och inspirerande fotbollsmiljö där vi lär av varandra.Vår strävan efter att skapa ett mer sammanhållet idrottsklimat innebär att vi arbetar med människor från alla bakgrunder, kulturer, åldrar och kön. Genom fotbollens universella språk, överbryggar vi klyftor och skapar en plats där alla känner sig välkomna och delaktiga.\", \"national_affiliation\": \"Riksidrottsförbundet (RF)\", \"fiscal_year_starts_mmdd\": \"0101\"}, \"title\": \"Övrig information\"}], \"free_text\": \"Bruket BK är ett fotbollslag som inte bara går för vinst på planen, utan också för att skapa en bättre och mer gemenskapsorienterad fotbollskultur i Fagersta.Vårt engagemang stannar dock inte där. Vi ser oss nämligen inte bara som ett fotbollslag, vi är en familj och en kraft som arbetar för integration, samhörighet och att knyta vänskapsband genom fotbollen. Vårt engagemang för Fagerstas fotbollsintresserade är något som vi är mycket stolta över.Att vi finns som ett alternativ för de vuxna och ungdomar som inte har råd eller som inte finner någon plats i stadens mer elitsatsande föreningar, är något som har mottagits varmt. Ett alternativ till FSIK och VIF är något som har saknats under många år och vi ser det som vår plikt att fortsätta finnas till för de som behöver det.En av våra mest framstående aspekter är vårt fokus på att involvera spelare oavsett ålder och tidigare erfarenhet.Vi har en imponerande grupp unga talanger som är passionerade för fotboll och som är redo att växa och utvecklas med oss. Vi har även äldre spelare som inte vill sluta spela så länge kroppen fortfarande orkar.Vi tror att genom att investera i dessa ungdomar och vuxna, investerar vi i en mer inkluderande och inspirerande fotbollsmiljö där vi lär av varandra.Vår strävan efter att skapa ett mer sammanhållet idrottsklimat innebär att vi arbetar med människor från alla bakgrunder, kulturer, åldrar och kön. Genom fotbollens universella språk, överbryggar vi klyftor och skapar en plats där alla känner sig välkomna och delaktiga.\"}','UNCONTACTED',0,NULL,'PROSPECT',1,5,'numeric_plus_next_last',NULL,'{\"founded_year\": 2021, \"contact_phones\": {\"mobile\": \"076-88 09 327\"}, \"verksamhet_raw\": \"Fotboll\", \"fiscal_year_start\": \"0101\", \"national_affiliation\": \"Riksidrottsförbundet (RF)\"}','2025-10-24 09:25:30.324','2025-10-24 09:25:30.324','cmh3lhm7e000tb5q8o1ngr574','cmh4nb8pa00ttoz01innubkvm',NULL,0,'Bruket BK är ett fotbollslag som inte bara går för vinst på planen, utan också för att skapa en bättre och mer gemenskapsorienterad fotbollskultur i Fagersta.Vårt engagemang stannar dock inte där. Vi ser oss nämligen inte bara som ett fotbollslag, vi är en familj och en kraft som arbetar för integration, samhörighet och att knyta vänskapsband genom fotbollen. Vårt engagemang för Fagerstas fotbollsintresserade är något som vi är mycket stolta över.Att vi finns som ett alternativ för de vuxna och ungdomar som inte har råd eller som inte finner någon plats i stadens mer elitsatsande föreningar, är något som har mottagits varmt. Ett alternativ till FSIK och VIF är något som har saknats under många år och vi ser det som vår plikt att fortsätta finnas till för de som behöver det.En av våra mest framstående aspekter är vårt fokus på att involvera spelare oavsett ålder och tidigare erfarenhet.Vi har en imponerande grupp unga talanger som är passionerade för fotboll och som är redo att växa och utvecklas med oss. Vi har även äldre spelare som inte vill sluta spela så länge kroppen fortfarande orkar.Vi tror att genom att investera i dessa ungdomar och vuxna, investerar vi i en mer inkluderande och inspirerande fotbollsmiljö där vi lär av varandra.Vår strävan efter att skapa ett mer sammanhållet idrottsklimat innebär att vi arbetar med människor från alla bakgrunder, kulturer, åldrar och kön. Genom fotbollens universella språk, överbryggar vi klyftor och skapar en plats där alla känner sig välkomna och delaktiga.',NULL,NULL),('cmh4nb8tr00ujoz011ec1t1wc','FRI',NULL,'2025-10-23 10:29:04.920','https://fri.fagersta.se/forening/visa.aspx?id=BRUKS-V%c3%84N','Bruksmusei Vänner',NULL,'[\"Kulturförening\"]','[\"Museiverksamhet\"]','[]','http://www.bruksmuseet.se','Glimmervägen 9','737 33','Fagersta','andreasson.l@telia.com',NULL,'{\"sections\": [{\"data\": {\"founded_year\": \"2011\", \"verksamhet_raw\": \"Museiverksamhet\", \"short_description\": \"Föreningens ändamål är att främja intresset för och kunskapen om bruksverksamhetens historia i Fagersta samt att verka för att Fagersta Bruksmuseum utvecklas till ett tidsenligt minnesmärke. Föreningen ordnar föredrag, visningar av museet för skolklasser och besökare, studieresor och översyn av inventarier.\", \"national_affiliation\": null, \"fiscal_year_starts_mmdd\": \"0101\"}, \"title\": \"Övrig information\"}], \"free_text\": \"Föreningens ändamål är att främja intresset för och kunskapen om bruksverksamhetens historia i Fagersta samt att verka för att Fagersta Bruksmuseum utvecklas till ett tidsenligt minnesmärke. Föreningen ordnar föredrag, visningar av museet för skolklasser och besökare, studieresor och översyn av inventarier.\"}','UNCONTACTED',0,NULL,'PROSPECT',1,6,'numeric_plus_next_last',NULL,'{\"founded_year\": 2011, \"contact_phones\": {\"mobile\": \"0705127921\"}, \"verksamhet_raw\": \"Museiverksamhet\", \"fiscal_year_start\": \"0101\"}','2025-10-24 09:25:30.351','2025-10-24 09:25:30.351','cmh3lhm7e000tb5q8o1ngr574','cmh4nb8pa00ttoz01innubkvm',NULL,0,'Föreningens ändamål är att främja intresset för och kunskapen om bruksverksamhetens historia i Fagersta samt att verka för att Fagersta Bruksmuseum utvecklas till ett tidsenligt minnesmärke. Föreningen ordnar föredrag, visningar av museet för skolklasser och besökare, studieresor och översyn av inventarier.',NULL,NULL),('cmh4nb8ug00un