INSERT INTO `DescriptionSection` VALUES ('cmh4gvd740005oz01z3blzzu0','cmh4gvd5w0003oz01se2sxr55','Övrig information','{\"founded_year\": \"2013\", \"verksamhet_raw\": \"Bio, Dans, Kulturverksamhet, Socialverksamhet\", \"short_description\": \"Anordnar olika evenemang på Adelsö.\", \"national_affiliation\": null, \"fiscal_year_starts_mmdd\": \"0101\"}',0,'2025-10-24 06:25:11.825','2025-10-24 06:25:11.825'),('cmh4gvd8a0009oz01za7iyv3g','cmh4gvd7s0007oz014e54fum6','Övrig information','{\"founded_year\": \"1974\", \"verksamhet_raw\": \"Kulturverksamhet\", \"short_description\": \"Sammordna de ideella adelsöföreningarnas verksamheter\", \"national_affiliation\": null, \"fiscal_year_starts_mmdd\": \"0101\"}',0,'2025-10-24 06:25:11.866','2025-10-24 06:25:11.866'),('cmh4gvd98000doz01lx8elun2','cmh4gvd8p000boz01qock3hzb','Övrig information','{\"founded_year\": \"2024\", \"verksamhet_raw\": \"Kulturverksamhet, Scenkonst, Teater\", \"short_description\": null, \"national_affiliation\": null, \"fiscal_year_starts_mmdd\": \"0625\"}',0,'2025-10-24 06:25:11.900','2025-10-24 06:25:11.900'),('cmh4gvda6000hoz01r4a7ji3d','cmh4gvd9m000foz01gzogahq8','Övrig information','{\"founded_year\": \"1974\", \"verksamhet_raw\": \"Hembygd\", \"short_description\": \"Hembygdslag\", \"national_affiliation\": \"Sv. Hembygdsförbundet\", \"fiscal_year_starts_mmdd\": \"0101\"}',0,'2025-10-24 06:25:11.934','2025-10-24 06:25:11.934'),('cmh4gvdb2000loz018k8p4i1c','cmh4gvdal000joz01cmnm9dij','Övrig information','{\"founded_year\": \"1927\", \"verksamhet_raw\": \"Gymnastik, Innebandy, Styrketräning, Tennis\", \"short_description\": \"Adelsö idrottsförening startade 1927. På Adelsö driver föreningen en fotbollsplan beläggen precis brevid Hovgården. Vår verksmhaet innefattar bl.a. Innebandy, gymnastik, tennis, boule, Gym (inne- och ute), frisbeegolf, bilbingo\", \"national_affiliation\": \"Riksidrottsförbundet\", \"fiscal_year_starts_mmdd\": \"0101\"}',0,'2025-10-24 06:25:11.966','2025-10-24 06:25:11.966'),('cmh4gvdby000poz015w5feokn','cmh4gvdbi000noz01zhahrkoo','Övrig information','{\"founded_year\": \"2017\", \"verksamhet_raw\": \"Kulturverksamhet\", \"short_description\": \"Adelsö Smedja vill främja möjligheter till kulturupplevelser och skapande verksamhet. En mötesplats för människor oavsett bakgrund, ålder och etnicitet. Utveckling av lokala konstnärer och konsthantverkare. Främja Adelsös och Ekerö attraktivitet som besöksmål för boende och turister.\", \"national_affiliation\": null, \"fiscal_year_starts_mmdd\": \"0101\"}',0,'2025-10-24 06:25:11.999','2025-10-24 06:25:11.999'),('cmh4gvdcx000toz011nwzb7rv','cmh4gvdcc000roz01v9hrkr4g','Övrig information','{\"founded_year\": \"2008\", \"verksamhet_raw\": \"Pensionärsverksamhet, Socialverksamhet\", \"short_description\": \"Äldrekontakt är en ideell förening som har som övergripande målsättning att främja hälsa och välbefinnande hos äldre. Särskilt hos äldre som befinner sig i en psykiskt, fysiskt, socialt och/eller ekonomiskt utsatt situation. Rent konkret främjar vi hälsa och välbefinnande hos äldre genom att minska ofrivillig ensamhet och sociala isolering. Vi har utvecklat en effektfull metod, baserad på forskning, som hjälper äldre ur ensamheten, genom att möjliggöra för dem att regelbundet träffa jämnåriga och samtidigt umgås över generationsgränserna. Vi har 17 års erfarenhet som visar att det går att göra stor skillnad i ensamma äldres liv. Vi kallar de äldre som vi hjälper för ”våra gäster”. Detta kommer naturligt för oss eftersom vi vill skapa en respektfull, varm, inkluderande och vänlig atmosfär i det vi gör.Äldrekontakt driver i dagsläget verksamhet i över 60 kommuner runtom i landet, där över 1700 volontärer varje månad hjälper 1200 ensamma äldre att träffas. Vi har funnits på Ekerö sedan 2018 och har i dagsläget två fikagrupper med upp till 8 äldre gäster i varje grupp, där grupp nummer 2 startade under 2024.\", \"national_affiliation\": null, \"fiscal_year_starts_mmdd\": \"0101\"}',0,'2025-10-24 06:25:12.033','2025-10-24 06:25:12.033'),('cmh4gvddt000xoz01hy96r3zx','cmh4gvddc000voz01oc5zk7i3','Övrig information','{\"founded_year\": null, \"verksamhet_raw\": \"Kulturverksamhet\", \"short_description\": null, \"national_affiliation\": null, \"fiscal_year_starts_mmdd\": \"0101\"}',0,'2025-10-24 06:25:12.065','2025-10-24 06:25:12.065'),('cmh4gvdeo0011oz01c2713tzg','cmh4gvde8000zoz01o46vtu8u','Övrig information','{\"founded_year\": null, \"verksamhet_raw\": \"Båtverksamhet\", \"short_description\": null, \"national_affiliation\": null, \"fiscal_year_starts_mmdd\": \"0101\"}',0,'2025-10-24 06:25:12.096','2025-10-24 06:25:12.096'),('cmh4gvdfp0015oz01fa083229','cmh4gvdf40013oz012p6i29iz','Övrig information','{\"founded_year\": null, \"verksamhet_raw\": \"Musik, Orkester\", \"short_description\": \"Annordnar festival\", \"national_affiliation\": null, \"fiscal_year_starts_mmdd\": \"0913\"}',0,'2025-10-24 06:25:12.133','2025-10-24 06:25:12.133'),('cmh4gvdh00019oz01ayocglwg','cmh4gvdgd0017oz01ebq3solv','Övrig information','{\"founded_year\": null, \"verksamhet_raw\": \"Båtverksamhet\", \"short_description\": null, \"national_affiliation\": null, \"fiscal_year_starts_mmdd\": \"0101\"}',0,'2025-10-24 06:25:12.180','2025-10-24 06:25:12.180'),('cmh4gvdi9001doz0180nqsuix','cmh4gvdhg001boz011pwswwj0','Övrig information','{\"founded_year\": null, \"verksamhet_raw\": \"Amerikansk fotboll, Flaggfotboll\", \"short_description\": \"Föreningen bedriver främst amerikansk fotboll för barn och ungdomar där målet är att ha kul och kunna utvecklas i sin egen takt. Vi är också vana att ta in nybörjare i alla åldrar och har oilka varianter av amerikansk fotboll som vi spelar beroende på vad våra deltagare är redo för och vad de vill. En viktig del av föreningen är att kunna anordna idrottsaktiviteter nära hemmet i idrotter som annars inte finns där du bor. Föreningen är en ideell breddidrottsförening där alla ska kunna vara med oavsett förutsättningar. Föreningen är alltid beredd att starta upp verksamhet i ditt kvarter så länge det finns en frivillig ledare och några barn som vill delta. För att ge möjlighet för alla som vill utveckla sig mer samlas vi regelbundet med alla våra träningsgrupper för att lära oss mer, både som ledare och deltagare.\", \"national_affiliation\": \"Sv.Amerikanska fotbollsförbund\", \"fiscal_year_starts_mmdd\": \"0101\"}',0,'2025-10-24 06:25:12.225','2025-10-24 06:25:12.225'),('cmh4gvdj8001hoz01qq2ncdt8','cmh4gvdio001foz01qat1j2ty','Övrig information','{\"founded_year\": \"2018\", \"verksamhet_raw\": \"(Saknas), Tyngdlyftning\", \"short_description\": \"Våra medlemmar i dagsläget är kvinnor och män i åldrarna 18-45 år, bestående av både de som vill tävla och de som är ute efter att träna i gott sällskap. Styrelsen jobbar aktivt för att öka trivseln och för att alla ska bli sedda, samt få utrymme, resurser och möjlighet attutvecklas. Detta har skett bland annat genom coachledda klasser, gemensam träning, nybörjarklasser, egna träningsprogram, klubbmästerskap och genom tävlingar. Vi jobbar även på våra sociala medier som en plattform att både sprida information på, samt motivation och gemenskap. Vi ämnar nu att utöka vår verksamhet till att inkludera barn- och ungdomsverksamhet på Ekerö inom idrotten Tyngdlyftning\", \"national_affiliation\": null, \"fiscal_year_starts_mmdd\": \"0719\"}',0,'2025-10-24 06:25:12.261','2025-10-24 06:25:12.261'),('cmh4gvdk2001loz01v9uz8cc3','cmh4gvdjl001joz01x9h82icv','Övrig information','{\"founded_year\": \"1974\", \"verksamhet_raw\": \"Körsång, Musik\", \"short_description\": null, \"national_affiliation\": null, \"fiscal_year_starts_mmdd\": \"0101\"}',0,'2025-10-24 06:25:12.290','2025-10-24 06:25:12.290'),('cmh4gvdkx001poz01zekcivlw','cmh4gvdkh001noz01z0tzbthx','Övrig information','{\"founded_year\": \"1950\", \"verksamhet_raw\": \"Gymnastik\", \"short_description\": \"Gymnastik,\", \"national_affiliation\": \"Sv.Gymnastikförbundet\", \"fiscal_year_starts_mmdd\": \"0901\"}',0,'2025-10-24 06:25:12.321','2025-10-24 06:25:12.321'),('cmh4gvdlr001toz015dsoqsmb','cmh4gvdlb001roz01f0td7jea','Övrig information','{\"founded_year\": \"1983\", \"verksamhet_raw\": \"Dans\", \"short_description\": \"Musik,Dans,\", \"national_affiliation\": \"Sv.Danssportförbundet\", \"fiscal_year_starts_mmdd\": \"0101\"}',0,'2025-10-24 06:25:12.351','2025-10-24 06:25:12.351'),('cmh4gvdmm001xoz01de1q7zsw','cmh4gvdm5001voz01oweogvk3','Övrig information','{\"founded_year\": null, \"verksamhet_raw\": \"Fotboll\", \"short_description\": \"Idrottsverksamhet\", \"national_affiliation\": null, \"fiscal_year_starts_mmdd\": \"0101\"}',0,'2025-10-24 06:25:12.382','2025-10-24 06:25:12.382'),('cmh4gvdnh0021oz01v0dajj6v','cmh4gvdn2001zoz01opmipk5r','Övrig information','{\"founded_year\": null, \"verksamhet_raw\": \"Kampsport\", \"short_description\": null, \"national_affiliation\": null, \"fiscal_year_starts_mmdd\": \"0101\"}',0,'2025-10-24 06:25:12.413','2025-10-24 06:25:12.413'),('cmh4gvdoc0025oz016cgmdusd','cmh4gvdnw0023oz01on7mpr4v','Övrig information','{\"founded_year\": \"1983\", \"verksamhet_raw\": \"Kulturverksamhet\", \"short_description\": \"Ekebyhovs slotts intresseförening är en sammanslutning av föreningar, för närvarande ca 40. Som enskild person kan man inte blimedlem. Vid årsmötet väljs en styrelse med representanter för medlemsföreningarna. Det finns också en Vänförening där enskildapersoner kan bli medlemmar.\", \"national_affiliation\": null, \"fiscal_year_starts_mmdd\": \"0101\"}',0,'2025-10-24 06:25:12.444','2025-10-24 06:25:12.444'),('cmh4gvdp50029oz01y9y05m5r','cmh4gvdop0027oz01i23cp2bs','Övrig information','{\"founded_year\": null, \"verksamhet_raw\": \"Kulturverksamhet\", \"short_description\": null, \"national_affiliation\": null, \"fiscal_year_starts_mmdd\": \"0101\"}',0,'2025-10-24 06:25:12.473','2025-10-24 06:25:12.473'),('cmh4gvdq1002doz01i1jaje0j','cmh4gvdpj002boz01z773uohb','Övrig information','{\"founded_year\": \"2019\", \"verksamhet_raw\": \"Handboll\", \"short_description\": \"Ekerö AIK är handbollsförening som har verksamhet i områdena kring Ekebyhovskolan, Sanduddens skola och Träkvista skola. Vi försöker bedriva vår verksamhet nära barnens vardag.\", \"national_affiliation\": \"Sv.Handbollsförbundet\", \"fiscal_year_starts_mmdd\": \"0701\"}',0,'2025-10-24 06:25:12.505','2025-10-24 06:25:12.505'),('cmh4gvdr2002hoz01t48d95p6','cmh4gvdqg002foz01npdyruxs','Övrig information','{\"founded_year\": \"1963\", \"verksamhet_raw\": \"Båtverksamhet, Segling\", \"short_description\": \"Klubbens ändamål är som ideell allmännyttig förening att främja båtsporten inom Ekerö kommun samt verka för sjösäkerhet, god miljö och gott sjömanskap i sjölivet. Verksamheten omfattar aktiviteter för både barn, ungdom och vuxna.Klubben vill i all sin verksamhet verka för en god miljö. Det gäller för såväl medlemmarnas båtliv, klubbens anläggningar som hanteringen av avfall. Klubbens styrelse hänvisar därmed till Svenska Båtunionens (SBU) målsättning att utveckla båtlivet i balans med natur och människa och därigenom uppnå en god miljö, där båtlivet skall utgöra en naturlig, erkänd och omistlig del av samhällslivet.\", \"national_affiliation\": \"Sv.Seglarförbundet\", \"fiscal_year_starts_mmdd\": \"0101\"}',0,'2025-10-24 06:25:12.543','2025-10-24 06:25:12.543'),('cmh4gvds5002loz01vaddegi1','cmh4gvdrn002joz01hatwq1hk','Övrig information','{\"founded_year\": \"2023\", \"verksamhet_raw\": \"BJJ, Kampsport\", \"short_description\": \"Målsättning för verksamhetenKlubbens övergripande målsättning under dess första verksamhetsår är att möta det ökadeintresset för jiu-jitsu i Ekerö kommun och bibehålla en hög nivå på träningen i samtligagrupper. Under 2023 kommer Ekerö Bjj även att utveckla NPF-verksamheten i samverkanmed grundsärskolan.\", \"national_affiliation\": null, \"fiscal_year_starts_mmdd\": \"0601\"}',0,'2025-10-24 06:25:12.581','2025-10-24 06:25:12.581'),('cmh4gvdt3002poz01djec5qfm','cmh4gvdsj002noz01f77zm48o','Övrig information','{\"founded_year\": null, \"verksamhet_raw\": \"Civilförsvar\", \"short_description\": null, \"national_affiliation\": null, \"fiscal_year_starts_mmdd\": \"0101\"}',0,'2025-10-24 06:25:12.615','2025-10-24 06:25:12.615'),('cmh4gvdty002toz01cnwv5d30','cmh4gvdti002roz012ywapbjh','Övrig information','{\"founded_year\": \"1998\", \"verksamhet_raw\": \"Bio, Kulturverksamhet\", \"short_description\": \"Underhållning\", \"national_affiliation\": null, \"fiscal_year_starts_mmdd\": \"0101\"}',0,'2025-10-24 06:25:12.647','2025-10-24 06:25:12.647'),('cmh4gvdut002xoz010ruxtbto','cmh4gvdud002voz01qlt344z2','Övrig information','{\"founded_year\": \"1921\", \"verksamhet_raw\": \"Allmänhetens istid, Armbrytning, Badminton, Bågskytte, Bordtennis, Fotboll, Futsal, Innebandy, Shorttrack\", \"short_description\": \"EKERÖ IK - En del av vår aktiva vardag. 100-årig flersektionsförening med 8 idrotter.Vår förening står för Glädje, Gemenskap, Trygghet, Respekt och Ansvar, Vi är engagerade och aktiva inom idrotten på Ekerö. Vår förening har över 1900 aktiva varav knappt 200 utövar fler än en idrott, med över 550 ideella ledare, tillsammans har vi mer än 8000 aktiviteter året runt. Vi driver Träkvistavallen (2 fotbollsplaner, 1 ishall och en friidrottsanläggning) med Ekerö kommun.Mer information om oss finns på www.ekeroik.se\", \"national_affiliation\": \"Riksidrottsförbundet\", \"fiscal_year_starts_mmdd\": \"0101\"}',0,'2025-10-24 06:25:12.677','2025-10-24 06:25:12.677'),('cmh4gvdvq0031oz01wsgvc3dr','cmh4gvdv8002zoz014zn87h5n','Övrig information','{\"founded_year\": \"1989\", \"verksamhet_raw\": \"Kampsport\", \"short_description\": \"Klubben är ansluten till Svenska Judoförbundet och vi utövar judo.\", \"national_affiliation\": \"Sv.Judoförbundet\", \"fiscal_year_starts_mmdd\": \"0101\"}',0,'2025-10-24 06:25:12.710','2025-10-24 06:25:12.710'),('cmh4gvdwl0035oz01i2fuwjs3','cmh4gvdw40033oz01wjitgm7k','Övrig information','{\"founded_year\": null, \"verksamhet_raw\": \"Kampsport\", \"short_description\": null, \"national_affiliation\": null, \"fiscal_year_starts_mmdd\": \"0101\"}',0,'2025-10-24 06:25:12.741','2025-10-24 06:25:12.741'),('cmh4gvdxh0039oz014wb3ydmz','cmh4gvdwz0037oz01lnhmdggz','Övrig information','{\"founded_year\": \"2011\", \"verksamhet_raw\": \"Konståkning\", \"short_description\": \"Konståkning\", \"national_affiliation\": \"Sv. konståkningsförbundet\", \"fiscal_year_starts_mmdd\": \"0701\"}',0,'2025-10-24 06:25:12.773','2025-10-24 06:25:12.773'),('cmh4gvdye003doz01cywzgxs0','cmh4gvdxv003boz01lerzrr01','Övrig information','{\"founded_year\": \"2021\", \"verksamhet_raw\": \"Cykel\", \"short_description\": \"Föreningen Ekerö MTB är till för alla som vill cykla MTB i Ekerö kommun (Cross Country, All mountain, Downhill, Freeride, Dirt Jump, Trail, Urban). Föreningen bedriver verksamhet för alla åldersnivåer och färdighetsnivåer. Vår hemmaarena är Jungfrusundsåsen och Ekebyhovsbacken, men vi cyklar på alla öar!\", \"national_affiliation\": \"Riksidrottsförbundet\", \"fiscal_year_starts_mmdd\": \"0101\"}',0,'2025-10-24 06:25:12.807','2025-10-24 06:25:12.807'),('cmh4gvdz8003hoz01c9bqt8g1','cmh4gvdyt003foz012rmktya1','Övrig information','{\"founded_year\": \"1980\", \"verksamhet_raw\": \"Hembygd, Historia, Kulturverksamhet, Möte\", \"short_description\": \"Hembygdsföreningen bedriver en bred verksamhet kring hembygdens dåtid, nutid och framtid. Vi skapar möten som ger kunskap och gemenskap, med föredrag, berättelser och vandringar. Vi har en årlig kulturresa sommartid och berättarafton sen höst. Vi ger ut skrifter och böcker och har ett digert fotoarkiv. Hembygdsföreningen bildades 1952 och slumrade in men återuppstod igen 1980.\", \"national_affiliation\": \"Sv. Hembygdsförbundet\", \"fiscal_year_starts_mmdd\": \"0101\"}',0,'2025-10-24 06:25:12.836','2025-10-24 06:25:12.836'),('cmh4gvdzz003loz01hlxqe0h1','cmh4gvdzl003joz012de2g4wq','Övrig information','{\"founded_year\": \"1965\", \"verksamhet_raw\": \"Pensionärsverksamhet\", \"short_description\": \"Vi verkar för