ella och museala verksamheten på Svartsjö Slott. Såväl genom egna arrangemang, som genom ekonomiska bidrag och volontärverksamhet. SSV ska också verka för att fördjupa och bredda kunskapen om Svartsjö Slott samt att den historiska miljön skyddas och bevaras.\", \"national_affiliation\": null, \"fiscal_year_starts_mmdd\": \"0101\"}',0,'2025-10-24 06:25:13.352','2025-10-24 06:25:13.352'),('cmh4gveeg005hoz019u1j1760','cmh4gvee1005foz01k0ag7h3o','Övrig information','{\"founded_year\": \"1911\", \"verksamhet_raw\": \"E-sport, Kulturverksamhet, Möte, Musik, Teater\", \"short_description\": \"Arrangerar evenemang\", \"national_affiliation\": null, \"fiscal_year_starts_mmdd\": \"0101\"}',0,'2025-10-24 06:25:13.384','2025-10-24 06:25:13.384'),('cmh4gvefd005loz016sl9help','cmh4gveeu005joz01n0biy7ws','Övrig information','{\"founded_year\": \"1977\", \"verksamhet_raw\": \"Hembygd, Historia, Kulturverksamhet\", \"short_description\": \"Vårdar fornlämningar så som runstenar och gravfält. Ordnar föredrag med arkeologisk inriktning, gör utflykter till arkeologiskt intressanta platser.\", \"national_affiliation\": \"Sv. Hembygdsförbundet\", \"fiscal_year_starts_mmdd\": \"0101\"}',0,'2025-10-24 06:25:13.417','2025-10-24 06:25:13.417'),('cmh4gvegd005poz01t5nen102','cmh4gvefq005noz01thb0mu62','Övrig information','{\"founded_year\": \"2024\", \"verksamhet_raw\": \"Basket, Bordtennis, Djur och natur, Fotboll, Innebandy, Käpphästridning\", \"short_description\": \"Föreningen har en stark vision att erbjuda meningsfulla och lärorika upplevelser för barn och ungdomar, med fokus på harmoni mellan människa, djur och natur. Då intresset visats stort för bollsporter försöker vi gynna även det. Hästis - En dag i veckan:Vi välkomnar varje vecka barn från skolan till vårt stall för en dag fylld med lärande och äventyr. Genom vårt program får barnen möjlighet att lära sig grunderna i hästskötsel, både praktiskt och teoretiskt. Vi strävar efter att ge dem en djupare förståelse för hästvård och hantering, samtidigt som de får möjlighet att prova på grundläggande ridning, med fokus på säkerhet och respekt för djuret. Dessutom planerar vi att fira högtider såsom påsk, Halloween och jul med olika teman för att skapa roliga och minnesvärda upplevelser för barnen.Ponnypatrullen - En dag för nybörjare:Vi kommer även att introducera en dag för Ponnypatrullen, där vi välkomnar nybörjare till stallet för att utforska skogen och delta i enklare ridpass på banan. Målet med gruppen är att främja harmoni och samspel med både hästar och natur. Liksom i Hästis-programmet kommer barnen att få lära sig grunderna i hästskötsel och ridning, vilket förväntas bidra till deras personliga utveckling och ökade självförtroende.Medryttareprogram:Vi kommer att fortsätta erbjuda möjligheten för barn och ungdomar att bli medryttare på våra hästar. Genom individuellt anpassade ridlektioner får varje deltagare möjlighet att utvecklas som ryttare, med stöd och vägledning från vårt erfarna team.Sommarläger:Vi planerar att arrangera hästläger under veckorna 24–26 för barn mellan 6–18 år. Dagarna kommer att fyllas med praktiska övningar och ridpass, där deltagarna får möjlighet att utforska olika aspekter av ridning, såsom dressyr, hoppning och trailridning. Dessutom kommer vi att erbjuda ett halvdagsläger under vecka 25 för de som önskar en kortare upplevelse.Hundläger:Vecka 26 planerar vi att hålla ett spännande hundläger för alla hundälskare i åldern 6–18 år. Deltagarna kommer att få testa olika hundsporter, såsom rallylydnad, agility och nose work, samt delta i gemensamma promenader med sina fyrbenta vänner.Vi kommer att fortsätta servera mat och fika till alla deltagare för att göra upplevelsen så komplett som möjligt. Genom dessa aktiviteter strävar vi efter att främja en kärlek och förståelse för djur och natur bland barn och ungdomar, samtidigt som vi erbjuder en trygg och rolig miljö för lärande och utveckling. Vi ser entusiastiskt fram emot att fortsätta vår verksamhet med samma engagemang och entusiasm under det kommande året.Miljö:Vi fortsätter att värna om vår miljö genom kontinuerligt underhåll av stall, hagar och ridbana för att säkerställa en hållbar och trivsam miljö för våra aktiviteter och våra djur.Denna verksamhetsberättelse för det kommande året ger en förhandsvisning av föreningens planerade aktiviteter och åtgärder, med fokus på att främja barns och ungdomars lärande och förståelse för djur och natur.Bollsporter:Flera av våra medlemmar önskar att aktiviteter med bollsporter kan erbjudas. Vi funderar på hur vi kan utveckla den biten.\", \"national_affiliation\": \"Junis\", \"fiscal_year_starts_mmdd\": \"0101\"}',0,'2025-10-24 06:25:13.454','2025-10-24 06:25:13.454'),('cmh4gvehc005toz01505qqrdg','cmh4gvegw005roz01ydfldtav','Övrig information','{\"founded_year\": \"1969\", \"verksamhet_raw\": \"Djur och natur, Friluftsliv, Paddling, Skidsport\", \"short_description\": \"Mulleverksamhet, vandring, skridsko, alpint, friluftsaktiviteter och kurser för barn, ungdomar och vuxna\", \"national_affiliation\": \"Friluftsfrämjandet\", \"fiscal_year_starts_mmdd\": \"0101\"}',0,'2025-10-24 06:25:13.488','2025-10-24 06:25:13.488'),('cmh4gvei7005xoz01p6k598jp','cmh4gvehq005voz01uculo80a','Övrig information','{\"founded_year\": \"2020\", \"verksamhet_raw\": \"Dans, Djur och natur, Fotboll, Friidrott, Friluftsliv, Gymnastik, Handboll, Innebandy, Konst, Konståkning, Körsång, Kulturverksamhet, Musik, Simning, Teater, Yoga\", \"short_description\": \"Föreningen har som ändamål att bedriva ideell verksamhet i form av aktiviteter för barn och föräldrar. Vidare har föreningen som ändamål att främja studie- och fritidsverksamhet för föreningens medlemmar och anordna möjligheter till friluftsliv, lärande lek, idrott och rörelse, kulturupplevelser och kulturutövande samt pedagogisk verksamhet.\", \"national_affiliation\": null, \"fiscal_year_starts_mmdd\": \"1030\"}',0,'2025-10-24 06:25:13.519','2025-10-24 06:25:13.519'),('cmh4gvej20061oz018nxnfr9r','cmh4gveil