ormation','{\"founded_year\": \"2011\", \"verksamhet_raw\": \"Kulturverksamhet\", \"short_description\": null, \"national_affiliation\": null, \"fiscal_year_starts_mmdd\": \"0101\"}',0,'2025-10-24 06:25:13.785','2025-10-24 06:25:13.785'),('cmh4gveq90075oz01f90nmlnr','cmh4gvepw0073oz017h2h3rs5','Övrig information','{\"founded_year\": \"1971\", \"verksamhet_raw\": \"Kulturverksamhet, Vävning\", \"short_description\": \"Vävning\", \"national_affiliation\": null, \"fiscal_year_starts_mmdd\": \"0101\"}',0,'2025-10-24 06:25:13.809','2025-10-24 06:25:13.809'),('cmh4gveqy0079oz018g8fvubu','cmh4gveqm0077oz01yo6bek9l','Övrig information','{\"founded_year\": null, \"verksamhet_raw\": \"Djur och natur\", \"short_description\": null, \"national_affiliation\": null, \"fiscal_year_starts_mmdd\": \"0101\"}',0,'2025-10-24 06:25:13.834','2025-10-24 06:25:13.834'),('cmh4gvern007doz01kdtw5ad8','cmh4gvera007boz01158vgx3v','Övrig information','{\"founded_year\": \"1988\", \"verksamhet_raw\": \"Golf\", \"short_description\": \"Golf\", \"national_affiliation\": \"Sv.Golfförbundet\", \"fiscal_year_starts_mmdd\": \"0101\"}',0,'2025-10-24 06:25:13.859','2025-10-24 06:25:13.859'),('cmh4gvesc007hoz01krjzzaah','cmh4gvery007foz01038illfx','Övrig information','{\"founded_year\": \"2021\", \"verksamhet_raw\": \"Allmänhetens istid, Ishockey, Styrketräning\", \"short_description\": \"Mälarö Hockeyförening est. 2021Mälarö hockeyförening bildades den 29 mars 2021 men har en historia som sträcker sig tillbaka till Ekerö IK och Skå IKs bildande.Från och med säsongen 21/22 så samlades vi i Mälaröarnas Hockeyförening.Föreningen bedriver hockeyverksamhet på Mälaröarna men några av våra spelare kommer från ”fastlandet” så det är inte bara spelare från Mälaröarna som väljer att spela ishockey hos oss.Vi är i dagsläget över 850 hockeymedlemmar i våra lag som täcker allt från A-lag ner till skridskoskolan, Veteraner till flicklag. Det är ett bevis på en väl fungerande verksamhet som vi är väldigt stolta över.Mälaröarnas Hockeyförening har sin hemvist i båda av Ekerö Kommuns ishallar,Vikingahallen som ligger vid Träkvista IP och Allhallen som ligger vid Svanängens IP.Mälaröarnas Hockeyförening är en av Stockholms största hockeyföreningar om man räknar antalet aktiva spelare. Det är fantastiskt och ett resultat av hårt arbete med att aktivera barn och ungdomar till att börja spela ishockey. Idrotten är och kommer att vara ett av samhällets viktigaste funktioner. Det är inom idrotten vi sätter grunderna till god hälsa, gemenskap, sysselsättning och bra värderingar vilket är mycket bra för vårt samhälle i övrigt.\", \"national_affiliation\": \"Sv.Ishockeyförbundet\", \"fiscal_year_starts_mmdd\": \"0501\"}',0,'2025-10-24 06:25:13.884','2025-10-24 06:25:13.884'),('cmh4gvesy007loz01ts502ypn','cmh4gvesm007joz01qnq59de7','Övrig information','{\"founded_year\": null, \"verksamhet_raw\": \"Djur och natur\", \"short_description\": null, \"national_affiliation\": null, \"fiscal_year_starts_mmdd\": \"0101\"}',0,'2025-10-24 06:25:13.906','2025-10-24 06:25:13.906'),('cmh4gveto007poz01cg7zn0tc','cmh4gvet9007noz01ybgmkmdn','Övrig information','{\"founded_year\": \"1977\", \"verksamhet_raw\": \"Djur och natur, Friluftsliv, Jakt\", \"short_description\": \"Mälarö jaktvårdskrets samlar Jägareförbundets ca 500 medlemmar som bor eller jagar inom Ekerö kommun. Följ oss här: https://www.facebook.com/groups/mjvk.offentlig\", \"national_affiliation\": \"Sv. Jägarförbundet\", \"fiscal_year_starts_mmdd\": \"0101\"}',0,'2025-10-24 06:25:13.933','2025-10-24 06:25:13.933'),('cmh4gveuh007toz015hja4v9q','cmh4gveu0007roz01arco3yfc','Övrig information','{\"founded_year\": \"2024\", \"verksamhet_raw\": \"Goshindo, Judo, Kampsport, Kickboxning, Pensionärsverksamhet, Självförsvar\", \"short_description\": null, \"national_affiliation\": \"Riksidrottsförbundet\", \"fiscal_year_starts_mmdd\": \"0101\"}',0,'2025-10-24 06:25:13.961','2025-10-24 06:25:13.961'),('cmh4gvev4007xoz01uzhrapem','cmh4gveus007voz010fc6rmjk