ursioner och andra aktiviteter vill vi också stimulera allmänhetens intresse för och öka kunskapen om fågelfaunan. Medlemstidskriften Fåglar på Mälaröarna ges ut en gång per år.\", \"national_affiliation\": null, \"fiscal_year_starts_mmdd\": \"0401\"}',0,'2025-10-24 06:25:14.324','2025-10-24 06:25:14.324'),('cmh4gvf59009hoz01ftocaqwe','cmh4gvf4w009foz01gnmomxwt','Övrig information','{\"founded_year\": \"1984\", \"verksamhet_raw\": \"Brädspel\", \"short_description\": \"Mälaröarnas Othellosällskap är en förening under Svenska Othelloförbundet. Vi arrangerar Othellospelträffar på Mälaröarna. 2017 startade vi upp ungdomsverksamhet. Vi är en fri spontan sammmanslutning av Othellointresserade i Ekerö kommun och öppen för alla som tycker om att spela Othello. Vi bedriver evenemang både för nya, glada amatörer som elitspelare. 2023 höll vi det första Mälarö Öppna Othelloturnering. 2024 i april arrangeras den andra Othelloturneringen. 2024 står klubben värd för Sweden Grand Prix, som är en internationell turnering.\", \"national_affiliation\": null, \"fiscal_year_starts_mmdd\": \"1001\"}',0,'2025-10-24 06:25:14.349','2025-10-24 06:25:14.349'),('cmh4gvf5x009loz01ioh67mir','cmh4gvf5k009joz01i9s4m6wn','Övrig information','{\"founded_year\": \"1968\", \"verksamhet_raw\": \"Ridsport\", \"short_description\": \"Vi arrangerar tävlingar, träningar och andra evenemang för våra ridsportintresserade medlemmar. Majoriteten av oss rider på Ekerö ridskolas hästar och ponnyer, men vi räknar även in privatryttare och andra hästentusiaster bland våra medlemmar.\", \"national_affiliation\": \"Riksidrottsförbundet\", \"fiscal_year_starts_mmdd\": \"0101\"}',0,'2025-10-24 06:25:14.374','2025-10-24 06:25:14.374'),('cmh4gvf6m009poz01leh10w7x','cmh4gvf69009noz01i97bkx2a','Övrig information','{\"founded_year\": \"2023\", \"verksamhet_raw\": \"Körsång, Kulturverksamhet, Musik, Orkester, Scenkonst, Teater\", \"short_description\": \"Vi vill tillföra kvalitativ och nyskapande scenkonst till kulturutbu