spel med spelare i olika åldrar samt att det är både herrar och damer i laget. Vi tränar två gånger i veckan under säsongen.\", \"national_affiliation\": \"Svenska Bowlingförbundet\", \"fiscal_year_starts_mmdd\": \"0601\"}',0,'2025-10-24 09:25:30.313','2025-10-24 09:25:30.313'),('cmh4nb8td00uhoz01hunu5z1l','cmh4nb8t000ufoz01vuhsm7rg','Övrig information','{\"founded_year\": \"2021\", \"verksamhet_raw\": \"Fotboll\", \"short_description\": \"Bruket BK är ett fotbollslag som inte bara går för vinst på planen, utan också för att skapa en bättre och mer gemenskapsorienterad fotbollskultur i Fagersta.Vårt engagemang stannar dock inte där. Vi ser oss nämligen inte bara som ett fotbollslag, vi är en familj och en kraft som arbetar för integration, samhörighet och att knyta vänskapsband genom fotbollen. Vårt engagemang för Fagerstas fotbollsintresserade är något som vi är mycket stolta över.Att vi finns som ett alternativ för de vuxna och ungdomar som inte har råd eller som inte finner någon plats i stadens mer elitsatsande föreningar, är något som har mottagits varmt. Ett alternativ till FSIK och VIF är något som har saknats under många år och vi ser det som vår plikt att fortsätta finnas till för de som behöver det.En av våra mest framstående aspekter är vårt fokus på att involvera spelare oavsett ålder och tidigare erfarenhet.Vi har en imponerande grupp unga talanger som är passionerade för fotboll och som är redo att växa och utvecklas med oss. Vi har även äldre spelare som inte vill sluta spela så länge kroppen fortfarande orkar.Vi tror att genom att investera i dessa ungdomar och vuxna, investerar vi i en mer inkluderande och inspirerande fotbollsmiljö där vi lär av varandra.Vår strävan efter att skapa ett mer sammanhållet idrottsklimat innebär att vi arbetar med människor från alla bakgrunder, kulturer, åldrar och kön. Genom fotbollens universella språk, överbryggar vi klyftor och skapar en plats där alla känner sig välkomna och delaktiga.\", \"national_affiliation\": \"Riksidrottsförbundet (RF)\", \"fiscal_year_starts_mmdd\": \"0101\"}',0,'2025-10-24 09:25:30.337','2025-10-24 09:25:30.337'),('cmh4nb8u400uloz016q3jos60','cmh4nb8tr00ujoz011ec1t1wc','Övrig information','{\"founded_year\": \"2011\", \"verksamhet_raw\": \"Museiverksamhet\", \"short_description\": \"Föreningens ändamål är att främja intresset för och kunskapen om bruksverksamhetens historia i Fagersta samt att verka för att Fagersta Bruksmuseum utvecklas till ett tidsenligt minnesmärke. Föreningen ordnar föredrag, visningar av museet för skolklasser och besökare, studieresor och översyn av inventarier.\", \"national_affiliation\": null, \"fiscal_year_starts_mmdd\": \"0101\"}',0,'2025-10-24 09:25:30.365','2025-10-24 09:25:30.365'),('cmh4nb8us00upoz01xk0sjmo0','cmh4nb8ug00unoz01joe3dlgj','Övrig information','{\"founded_year\": \"1975\", \"verksamhet_raw\": \"Båtklubb\", \"short_description\": \"Båtklubb\", \"national_affiliation\": \"Svenska Båtunionen\", \"fiscal_year_starts_mmdd\": \"0101\"}',0,'2025-10-24 09:25:30.388','2025-10-24 09:25:30.388'),('cmh4nb8vf00utoz01yidc5vc2','cmh4nb8v200uroz01qbpvd2yt','Övrig information','{\"founded_year\": \"2012\", \"verksamhet_raw\": \"Konst\", \"short_description\": \"Skulpturpark efter ån i Ängelsberg, marken ägs av Nordstjärnan som driver Engelsbergs bruk.\", \"national_affiliation\": null, \"fiscal_year_starts_mmdd\": \"0101\"}',0,'2025-10-24 09:25:30.411','2025-10-24 09:25:30.411'),('cmh4nb8w200uxoz010bz7nlnl','cmh4nb8vq00uvoz01qmorm1gg','Övrig information','{\"founded_year\": \"2007\", \"verksamhet_raw\": \"Intresseförening\", \"short_description\": \"Engelsbergsbygdens Intresseförening är en ideell förening, partipolitiskt obunden och har till uppgift att verka för Ängelsbergsbygdens liv och utveckling, att ta tillvara medlemmarnas intressen samt främja samarbete och kontakt.\", \"national_affiliation\": null, \"fiscal_year_starts_mmdd\": \"0101\"}',0,'2025-10-24 09:25:30.434','2025-10-24 09:25:30.434'),('cmh4nb8wu00v1oz01