iteter och främja konstnärer och esteter, konsthantverk och kultur i Fagersta kommun med omnejd.\", \"national_affiliation\": null, \"fiscal_year_starts_mmdd\": \"0101\"}',0,'2025-10-24 09:25:30.821','2025-10-24 09:25:30.821'),('cmh4nb97d00whoz01v1n21hzs','cmh4nb97200wfoz013zw3noiz','Övrig information','{\"founded_year\": \"1946\", \"verksamhet_raw\": \"Bil- och motorklubb, Motorsport\", \"short_description\": \"Att vara en förening som tillvaratar intresset för motorsport i alla dess former samt främjar sportens utveckling.\", \"national_affiliation\": null, \"fiscal_year_starts_mmdd\": \"1101\"}',0,'2025-10-24 09:25:30.841','2025-10-24 09:25:30.841'),('cmh4nb97y00wloz014kckusw5','cmh4nb97n00wjoz0178e6mjwo','Övrig information','{\"founded_year\": \"1957\", \"verksamhet_raw\": \"Naturskydd\", \"short_description\": \"Naturskyddsföreningen är en demokratisk, partipolitiskt och religiöst obunden ideell förening för naturskydd, naturvård och miljövård. Vi är en demokratisk, medlemsbaserad förening som driver viktiga natur- och miljöfrågor lokalt, regionalt, nationellt och internationellt.Vi har en unik kraft som folkrörelse och vill vara en naturlig hemvist för alla miljöengagerade. Vi finns i hela landet och verkar på alla nivåer i samhället.Vi har en bred och djup kompetens grundad i vetenskap och fakta. Vi väcker engagemang för naturen, sprider kunskap och utbildar om miljöfrågor, verkar för skydd och vård av värdefull natur, skapar opinion samt påverkar, granskar och utkräver ansvar av makthavare och lagstiftare.Vi verkar för en hållbar konsumtionskultur samt förändrade normer och beteenden. Vi tror att verklig förändring bygger på solidaritet i hela samhället, mellan generationer och över landsgränser.Vi bidrar till konkreta lösningar för ett modernt samhälle på en frisk och levande planet.Vi samarbetar med nätverk, organisationer och företag i såväl Sverige, som i EU och världen.\", \"national_affiliation\": \"Svenska Naturskyddsföreningen\", \"fiscal_year_starts_mmdd\": \"0101\"}',0,'2025-10-24 09:25:30.862','2025-10-24 09:25:30.862'),('cmh4nb98n00wpoz01xh2iz0io','cmh4nb98800wnoz01tww0f91t','Övrig information','{\"founded_year\": \"1942\", \"verksamhet_raw\": \"Cykling, Löpning, Orientering, Skidor\", \"short_description\": \"Föreningen har som ändamål att bedriva idrottslig verksamhet i enlighet med ”Idrottsrörelsens verksamhetsidé, vision och värdegrund” (1 kap. RF:s stadgar).Föreningen ska bedriva följande idrotter:Orientering (OL, MTBO, SkidO), och närbesläktade aktiviteter såsom löpning, cykling och skidåkning med särskild inriktning på:- att befrämja folkhälsan genom aktivt friluftsliv- att inspirera ungdomar till idrottslig verksamhet- att ta tillvara äldres idrottsintresse\", \"national_affiliation\": null, \"fiscal_year_starts_mmdd\": \"1101\"}',0,'2025-10-24 09:25:30.887','2025-10-24 09:25:30.887'),('cmh4nb99800wtoz01mxojfm5a','cmh4nb98y00wroz0158hwmql4','Övrig information','{\"founded_year\": \"1992\", \"verksamhet_raw\": \"Bowling, Pensionärsförening\", \"short_description\": \"Aktivt spel i serier med flera lag inom Gästrikland, Dalarna och Västmanland, plus två organiserade träningar i veckan under augusti - maj. Flera med 65+ och uppåt deltar efter bästa förmåga.\", \"national_affiliation\": \"Svenska Bowlingförbundet\", \"fiscal_year_starts_mmdd\": \"0101\"}',0,'2025-10-24 09:25:30.909','2025-10-24 09:25:30.909'),('cmh4nb9a200wxoz011pl05x5e','cmh4nb99m00wvoz01uxp43ynp','Övrig information','{\"founded_year\": \"1973\", \"verksamhet_raw\": \"Funktionsrätt\", \"short_description\": \"Syftet med föreningen är att öka kunskapen om de reumatiska sjukdomarna och bidra till att människor med dessa sjukdomar får ett bra liv. Detta gör vi genom att träffas under trevliga former, lyssna på föreläsningar, delta i hälsofrämjande aktiviteter som vattengympa, mm, utbyta erfarenheter och ha roligt tillsammans.Vi är många som kan stötta varandra, och hjälpa till att göra livet bättre och roligare. Tillsammans är vi starka!\