 våra anläggningar på Onsjövallen och Fageråsen.Föreningens stora inkomstkälla är pappersinsamlingen. Detta sker första måndagen i varje månad. Det är 14 fordon och 60 personer igång under en pappersmåndag. Vi har vår avlastningsplats uppe vid Fårbo hos Nordfeldts åkeri.\", \"national_affiliation\": \"Riksidrottsförbundet (RF)\", \"fiscal_year_starts_mmdd\": \"0101\"}',0,'2025-10-24 09:25:31.082','2025-10-24 09:25:31.082'),('cmh4nb9es00xgoz01ljyrh0ly','cmh4nb9eg00xeoz0103z7u1hx','Övrig information','{\"founded_year\": \"1874\", \"verksamhet_raw\": \"Blåsorkester, Musik\", \"short_description\": \"Fagersta stadsmusikkår är en blåsorkester med gamla anor och rötter i den gamla bruksmusiken som växte fram vid Fagersta bruk, orkestern startades där redan 1874. Idag är vi en ideell förening som träffas och repeterar på onsdagkvällar. Orkestern består av vuxna amatörmusiker, musiklärare och elever vid Fagersta kulturskola. Alla blåsmusikanter i närområdet är välkomna att vara med. Vi försöker göra några egna konserter varje år, samarbetar med Kulturskolans blåselever och deltar dessutom vid \\\"Sjung in advent\\\" i Västanfors kyrka, vid kommunens nationaldagsfirande samt vid Brinellskolans studentutspring.\", \"national_affiliation\": null, \"fiscal_year_starts_mmdd\": \"0101\"}',0,'2025-10-24 09:25:31.108','2025-10-24 09:25:31.108'),('cmh4nb9fe00xkoz01uhrtxz56','cmh4nb9f200xioz01fy6molrv','Övrig information','{\"founded_year\": \"1955\", \"verksamhet_raw\": \"Teater\", \"short_description\": \"Fagersta Teaterstudio/Norrby Teater är en ideell förening som startade den 15 september 1955 och är en av de äldsta stationerade amatörteaterföreningarna i landet. Vi kan ha grupper från fyra år och uppåt. Vi arbetar med allt från teater, rekvisita, kostym, smink, dockteater, teknik och film mm. Vi skapar ett sammanhang till de flesta som vill vara med på och kring teatern. Vi försöker fånga upp våra medlemmars tankar och idéer. Vi samarbetar med andra organisationer och Fagersta 